import React from 'react'
import styles from "./navbar.css";

function NavBar() {
  return (
    <nav className={styles.nav}>
      <ul className={styles.ul}>
        <li className={styles.li}></li>
        <li id={styles["other_color"]}></li>
        <li className={styles.li}></li>
      </ul>
    </nav>
  )
}

export default NavBar;
